import React from "react";
import {
  CarouselProvider,
  Slider,
  Slide,
  ButtonBack,
  ButtonNext,
} from "pure-react-carousel";
import "pure-react-carousel/dist/react-carousel.es.css";

import Mycard from "./productCard.js";

import "./productCarousel.css";

const Imagecarousel = () => {
  return (
    <CarouselProvider
      visibleSlides={3}
      totalSlides={6}
      step={1}
      naturalSlideWidth={400}
      naturalSlideHeight={500}
    >
      <div className="">
        <Slider className="slider">
          <Slide index={0}>
            <Mycard cardno="1" style={{ "max-width": "300px" }} />
          </Slide>
          <Slide index={1}>
            <Mycard cardno="2" />
          </Slide>
          <Slide index={2}>
            <Mycard cardno="3" />
          </Slide>
          <Slide index={3}>
            <Mycard cardno="4" />
          </Slide>
          <Slide index={4}>
            <Mycard cardno="5" />
          </Slide>
          <Slide index={5}>
            <Mycard cardno="6" />
          </Slide>
        </Slider>
        <ButtonBack className="buttonBack">Back</ButtonBack>
        <ButtonNext className="buttonNext">Next</ButtonNext>
      </div>
    </CarouselProvider>
  );
};

export default Imagecarousel;
